	<script>

	$(document).ready(function() {

		if( $( '#car-slide' ) ) {

			$('#car-slide').bjqs({

				'height' : 225,

				'width' : 300,

				'responsive' : true,

				'showmarkers' : false,

				'randomstart' : false

			});

		}
		
		$('.current').each(function(index, element) {
			$(this).wrap("<div class='CurrentPageBorder'></div>");
		});

		if( $('#order-results') ){
			$( '#order-results' ).on( 'change', function(  ){
				var str = "";
				$("#order-results select option:selected").each(function () {
					str += $(this).val() + " ";
				});
				if( str != 'order' ) {
					str = str.split('-')
					key = str[0]
					order = str[1]
					var form = document.getElementById( 'refine' );
					$('#order-field').val( order );
					$('#key-field').val( key );
					form.submit();
				}
			})
		}
		<?php 
		
		if (!function_exists("current_page_url")){
			function current_page_url() {
				$pageURL = 'http';
				if( isset($_SERVER["HTTPS"]) ) {
					if ($_SERVER["HTTPS"] == "on") {$pageURL .= "s";}
				}
				$pageURL .= "://";
				if ($_SERVER["SERVER_PORT"] != "80") {
					$pageURL .= $_SERVER["SERVER_NAME"].":".$_SERVER["SERVER_PORT"].$_SERVER["REQUEST_URI"];
				} else {
					$pageURL .= $_SERVER["SERVER_NAME"].$_SERVER["REQUEST_URI"];
				}
				return $pageURL;
			}
		}
		
		if ( stripos((string)parse_url(current_page_url(),PHP_URL_PATH) , "/search/cars") === false ){
		?>
		var nAMJ_CurrentPageIndex = -1;
		
		function AMJ_ChangePageLinksToFormSubmit(){
			if (nAMJ_CurrentPageIndex <=0)
				nAMJ_CurrentPageIndex = 1;

			$( '.page-numbers' ).each(function(index, element) {
				var sType = $(this).prop('nodeName');
				if (sType.toLowerCase() == "a"){
					$(this).removeAttr("href","");
					$(this).click(function(event){
						event.preventDefault();
						var sButtonValue = $(this).text();
						var nButtonPageIndex = parseInt(sButtonValue);
						if (sButtonValue.toLowerCase().indexOf("next") >= 0)
							nButtonPageIndex = nAMJ_CurrentPageIndex + 1;
						if (sButtonValue.toLowerCase().indexOf("prev") >= 0)
							nButtonPageIndex = nAMJ_CurrentPageIndex - 1;
						$("#pagenumberbuttonclick").val(nButtonPageIndex);
						var form = document.getElementById( 'refine' );
						form.submit();
					});
				}
			});
		}

		
		if( $('.pagination') ){
			$( '.page-numbers' ).each(function(index, element) {
				var sType = $(this).prop('nodeName');
				if (sType.toLowerCase() == "span"){
					if (nAMJ_CurrentPageIndex == -1){
						var nSpanNumber = parseInt($(this).text());
						if (nSpanNumber > 0){
							nAMJ_CurrentPageIndex = nSpanNumber;
							AMJ_ChangePageLinksToFormSubmit();
						}
					}
				}
            });
		}
		<?php } ?>


		$( '.date-form' ).minical({

			'date_changed': function(  ) {

				var hire_id = $(this).attr('data-hire');

				var from_original = $( '#hire-from-' + hire_id ).val(  ).split( '/' );

				var to_original = $( '#hire-to-' + hire_id ).val(  ).split( '/' );

				var from = new Date( from_original[2], from_original[1], from_original[0] );

				var to = new Date( to_original[2], to_original[1], to_original[0] );

				var timeDiff = Math.abs(from.getTime() - to.getTime());

				var diffDays = Math.ceil(timeDiff / (1000 * 3600 * 24));

				if( !isNaN(diffDays) ) {

					var price = $( '#hire-price-' + hire_id ).attr( 'data-price' );

					var final_price = price * diffDays;

					if( diffDays >= 365 ) {

						final_price = final_price - (final_price/10);

					}

					final_price = final_price.toFixed(2);

					console.log( final_price );

					$( '#hire-price-' + hire_id ).html( final_price );

				}

			}

		});

		$( '.date-form' ).change(  );

		$('.finance-drop').click(function() {

			$('.calculator').slideToggle('slow', function() {

			// Animation complete.

			});

			return false;

		});



		$( '#cookie_close' ).click( function( e ) {

			window.location.href = "http://www.google.com";

			e.preventDefault(  );

		});



		$( '#cookie_accept' ).click( function( e ) {

			$.cookie( 'wp_euro_cookie_test', true, { expires: 30 } );

			$( '#euro_cookie' ).fadeOut(  );

			e.preventDefault(  );

		});



		$( '.model-filter a' ).click( function( e ) {

			e.preventDefault(  );

			var modelid = $(this).attr('data-id');

			var form = document.getElementById( 'refine' );

			$('#model-field').val( modelid );

			form.submit();

		});

		$( '.lightbox-cars' ).fancybox({

			openEffect : 'none',

			closeEffect : 'none'

		});

		$( '.lightbox' ).fancybox({

			openEffect : 'none',

			closeEffect : 'none'

		});

		$( '#enquire-button' ).fancybox({

			maxWidth   	: 500,

			maxHeight  	: 1000,

			fitToView  	: false,

			width      		: '70%',

			height     		: '95%',

			autoSize   	: false,

